import React from 'react';
import {
    GalleryContainer,
    ImageContainer,
    Image,
} from './styles'

type Props = {
    images: string[]
}

export const Gallery = ({ images } : Props ) => {
    return (
        <GalleryContainer>
            {images.map((imageUrl, index) => (
            <ImageContainer key={index}>
                <Image src={imageUrl} alt={`Gallery Image ${index}`} />
            </ImageContainer>
            ))}
        </GalleryContainer>
    );
};
